import React from "react";
import Card from "./Card";

const CardList = ({ memes }) => {
  return (
    <div>
      <Card
        id={memes[0].id}
        img={memes[0].img}
        name={memes[0].name}
        email={memes[0].email}
      />
      <Card
        id={memes[1].id}
        img={memes[0].img}
        name={memes[1].name}
        email={memes[1].email}
      />
      <Card
        id={memes[2].id}
        img={memes[0].img}
        name={memes[2].name}
        email={memes[2].email}
      />
    </div>
  );
};
export default CardList;
